      var now = new Date();
      var hour = now.getHours(); // 时
      var min = now.getMinutes(); // 分
      var sec = now.getSeconds(); // 秒

      var h = 24 - hour; // 倒计时 时
      if (min > 0 || sec > 0) {
        h -= 1;
      }
      var m = 60 - min; // 倒计时 分
      if (sec > 0) {
        m -= 1;
      }
      if (m == 60) {
        m = 0;
      }
      var s = 60 - sec; // 倒计时 秒
      if (s == 60) {
        s = 0;
      }

      var result = h * 3600 + m * 60 + s;
      //   console.log(result);
      return result;
